from unittest import TestCase

from bb_wrapper.services import QRCodeService


class BarcodeTestCase(TestCase):
    maxDiff = None

    def test_generate_qrcode_b64image_1(self):
        """
        Dado:
            - um 'qrcode_data'
        Quando:
            - for chamado QRCodeService().generate_qrcode_b64image(barcode_number)
        Então:
            - o resultado deve ser ¯\_(ツ)_/¯  # noqa
        """
        qrcode_data = "00020101021226870014br.gov.bcb.pix2565qrcodepix-h.bb.com.br/pix/v2/80e85ed0-4fb6-4d3f-bc29-41f072df75ac520400005303986540135802BR5925EMPRORT AMBIENTAL        6008BRASILIA62070503***63048DDF"  # noqa

        result = QRCodeService().generate_qrcode_b64image(qrcode_data)

        expected = "data:image/svg+xml;base64,"  # noqa

        self.assertEqual(result, expected)
